contracts/interfaces/IJobMarketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

interface IJobMarketplace {
    // Structs
    struct Job {
        uint256 id;
        address employer;
        string title;
        string description;
        uint256 budget;
        bool isActive;
        address selectedFreelancer;
        JobStatus status;
    }

    struct Profile {
        string name;
        string skills;
        uint256 rating;
        uint256 totalRatings;
        bool isRegistered;
    }

    struct Application {
        uint256 jobId;
        address freelancer;
        string proposal;
        uint256 proposedPrice;
        bool isAccepted;
    }

    // Enums
    enum JobStatus { Open, InProgress, Completed, Cancelled }

    // Events
    event JobCreated(uint256 indexed jobId, address indexed employer, string title, uint256 budget);
    event ApplicationSubmitted(uint256 indexed jobId, address indexed freelancer);
    event FreelancerSelected(uint256 indexed jobId, address indexed freelancer);
    event JobCompleted(uint256 indexed jobId, address indexed freelancer, uint256 payment);
    event ProfileUpdated(address indexed user, string name);
    event RatingSubmitted(address indexed rated, uint256 rating);

    // Core Functions
    function createProfile(string memory _name, string memory _skills) external;
    function postJob(string memory _title, string memory _description, uint256 _budget) external returns (uint256);
    function applyForJob(uint256 _jobId, string memory _proposal, uint256 _proposedPrice) external;
    function selectFreelancer(uint256 _jobId, address _freelancer) external;
    function completeJob(uint256 _jobId) external payable;
    function submitRating(address _rated, uint256 _rating) external;

    // View Functions
    function getJob(uint256 _jobId) external view returns (Job memory);
    function getProfile(address _user) external view returns (Profile memory);
    function getJobApplications(uint256 _jobId) external view returns (Application[] memory);
}

contracts/JobMarketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./interfaces/IJobMarketplace.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract JobMarketplace is IJobMarketplace, ReentrancyGuard, Pausable, Ownable {
    // State Variables
    mapping(uint256 => Job) public jobs;
    mapping(address => Profile) public profiles;
    mapping(uint256 => Application[]) public jobApplications;
    mapping(uint256 => mapping(address => bool)) public hasApplied;

    uint256 public jobCounter;

    // Modifiers
    modifier onlyEmployer(uint256 _jobId) {
        require(jobs[_jobId].employer == msg.sender, "Not the employer");
        _;
    }

    modifier jobExists(uint256 _jobId) {
        require(_jobId < jobCounter, "Job does not exist");
        _;
    }

    modifier profileRequired() {
        require(profiles[msg.sender].isRegistered, "Profile not registered");
        _;
    }

    // Constructor
    constructor() Ownable(msg.sender) {}

    // Core Functions
    function createProfile(string memory _name, string memory _skills)
        external
        override
        whenNotPaused
    {
        require(!profiles[msg.sender].isRegistered, "Profile already exists");

        profiles[msg.sender] = Profile({
            name: _name,
            skills: _skills,
            rating: 0,
            totalRatings: 0,
            isRegistered: true
        });

        emit ProfileUpdated(msg.sender, _name);
    }

    function postJob(
        string memory _title,
        string memory _description,
        uint256 _budget
    )
        external
        override
        whenNotPaused
        profileRequired
        returns (uint256)
    {
        uint256 jobId = jobCounter++;

        jobs[jobId] = Job({
            id: jobId,
            employer: msg.sender,
            title: _title,
            description: _description,
            budget: _budget,
            isActive: true,
            selectedFreelancer: address(0),
            status: JobStatus.Open
        });

        emit JobCreated(jobId, msg.sender, _title, _budget);
        return jobId;
    }

    function applyForJob(
        uint256 _jobId,
        string memory _proposal,
        uint256 _proposedPrice
    )
        external
        override
        whenNotPaused
        jobExists(_jobId)
        profileRequired
    {
        require(jobs[_jobId].isActive, "Job is not active");
        require(!hasApplied[_jobId][msg.sender], "Already applied");
        require(jobs[_jobId].employer != msg.sender, "Cannot apply to own job");

        Application memory application = Application({
            jobId: _jobId,
            freelancer: msg.sender,
            proposal: _proposal,
            proposedPrice: _proposedPrice,
            isAccepted: false
        });

        jobApplications[_jobId].push(application);
        hasApplied[_jobId][msg.sender] = true;

        emit ApplicationSubmitted(_jobId, msg.sender);
    }

    function selectFreelancer(uint256 _jobId, address _freelancer)
        external
        override
        whenNotPaused
        jobExists(_jobId)
        onlyEmployer(_jobId)
    {
        require(jobs[_jobId].status == JobStatus.Open, "Job not open");
        require(hasApplied[_jobId][_freelancer], "Freelancer has not applied");

        jobs[_jobId].selectedFreelancer = _freelancer;
        jobs[_jobId].status = JobStatus.InProgress;

        emit FreelancerSelected(_jobId, _freelancer);
    }

    function completeJob(uint256 _jobId)
        external
        override
        payable
        whenNotPaused
        jobExists(_jobId)
        onlyEmployer(_jobId)
        nonReentrant
    {
        Job storage job = jobs[_jobId];
        require(job.status == JobStatus.InProgress, "Job not in progress");
        require(msg.value >= job.budget, "Insufficient payment");

        job.status = JobStatus.Completed;

        // Transfer full payment to freelancer
        payable(job.selectedFreelancer).transfer(msg.value);

        emit JobCompleted(_jobId, job.selectedFreelancer, msg.value);
    }

    function submitRating(address _rated, uint256 _rating)
        external
        override
        whenNotPaused
        profileRequired
    {
        require(_rating >= 1 && _rating <= 5, "Invalid rating");
        require(_rated != msg.sender, "Cannot rate yourself");
        require(profiles[_rated].isRegistered, "Profile does not exist");

        Profile storage ratedProfile = profiles[_rated];
        uint256 newTotalRating = (ratedProfile.rating * ratedProfile.totalRatings) + _rating;
        ratedProfile.totalRatings++;
        ratedProfile.rating = newTotalRating / ratedProfile.totalRatings;

        emit RatingSubmitted(_rated, _rating);
    }

    // View Functions
    function getJob(uint256 _jobId)
        external
        view
        override
        returns (Job memory)
    {
        return jobs[_jobId];
    }

    function getProfile(address _user)
        external
        view
        override
        returns (Profile memory)
    {
        return profiles[_user];
    }

    function getJobApplications(uint256 _jobId)
        external
        view
        override
        returns (Application[] memory)
    {
        return jobApplications[_jobId];
    }

    // Admin Functions
    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    // Emergency withdraw function
    function withdrawStuckFunds() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}

contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.20;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

